description:
Each season has been cut into a &quot;seamless&quot; file.

Because I didn't have original footage to work with, I'm not completely happy with some of the cuts between episodes. But all-in-all it works really well.

Check out the original videos at http://www.rocketjump.com
Dont be cheap! Go buy some cool shit from them at http://shop.rocketjump.com

Also, support the creators by liking/favouriting  the videos on youtube:
Season 1: http://bombch.us/Kha
Season 2: http://bombch.us/Khb

